import React, { useState, useEffect } from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion';
import { useInView } from 'react-intersection-observer';
import { FaCode, FaTools, FaCertificate, FaLanguage } from 'react-icons/fa';

const SkillsContainer = styled.section`
  padding: 120px 0;
  background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
  color: white;
  position: relative;
  overflow: hidden;

  &::before {
    content: '';
    position: absolute;
    top: 0;
    left: 0;
    right: 0;
    bottom: 0;
    background: 
      radial-gradient(circle at 20% 80%, rgba(255, 255, 255, 0.1) 0%, transparent 50%),
      radial-gradient(circle at 80% 20%, rgba(255, 255, 255, 0.05) 0%, transparent 50%);
    z-index: 1;
  }
`;

const Container = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  padding: 0 ${props => props.theme.spacing.lg};
  position: relative;
  z-index: 2;
`;

const SectionHeader = styled(motion.div)`
  text-align: center;
  margin-bottom: 80px;
`;

const SectionTitle = styled.h2`
  font-size: clamp(2.5rem, 5vw, 3.5rem);
  font-weight: ${props => props.theme.fonts.weights.bold};
  color: white;
  margin-bottom: 20px;
  position: relative;

  &::after {
    content: '';
    position: absolute;
    bottom: -15px;
    left: 50%;
    transform: translateX(-50%);
    width: 80px;
    height: 4px;
    background: linear-gradient(90deg, #f093fb, #f5576c);
    border-radius: 2px;
  }
`;

const SectionSubtitle = styled.p`
  font-size: clamp(1.1rem, 2.5vw, 1.3rem);
  color: rgba(255, 255, 255, 0.9);
  max-width: 700px;
  margin: 0 auto;
  line-height: 1.7;
  font-weight: ${props => props.theme.fonts.weights.medium};
`;

const SkillsGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(350px, 1fr));
  gap: 40px;
  margin-bottom: 80px;

  @media (max-width: ${props => props.theme.breakpoints.md}) {
    grid-template-columns: 1fr;
  }
`;

const SkillCategory = styled(motion.div)`
  background: rgba(255, 255, 255, 0.1);
  backdrop-filter: blur(20px);
  border-radius: 25px;
  padding: 40px 30px;
  border: 1px solid rgba(255, 255, 255, 0.2);
  box-shadow: 
    0 20px 40px rgba(0, 0, 0, 0.2),
    0 0 0 1px rgba(255, 255, 255, 0.1);
  position: relative;
  overflow: hidden;
  transition: all 0.3s cubic-bezier(0.4, 0, 0.2, 1);

  &::before {
    content: '';
    position: absolute;
    top: 0;
    left: 0;
    right: 0;
    height: 4px;
    background: linear-gradient(90deg, #f093fb, #f5576c);
  }

  &:hover {
    transform: translateY(-8px);
    background: rgba(255, 255, 255, 0.15);
    box-shadow: 
      0 30px 60px rgba(0, 0, 0, 0.3),
      0 0 0 1px rgba(255, 255, 255, 0.2);
  }
`;

const CategoryHeader = styled.div`
  display: flex;
  align-items: center;
  gap: 15px;
  margin-bottom: 30px;
`;

const CategoryIcon = styled.div`
  width: 60px;
  height: 60px;
  border-radius: 20px;
  background: linear-gradient(135deg, #f093fb, #f5576c);
  display: flex;
  align-items: center;
  justify-content: center;
  color: white;
  font-size: 28px;
  box-shadow: 0 10px 25px rgba(240, 147, 251, 0.3);
`;

const CategoryTitle = styled.h3`
  font-size: ${props => props.theme.fonts.sizes.xl};
  font-weight: ${props => props.theme.fonts.weights.bold};
  color: white;
`;

const SkillList = styled.div`
  display: grid;
  gap: 20px;
`;

const SkillItem = styled.div`
  border-bottom: 1px solid rgba(255, 255, 255, 0.1);
  padding-bottom: 20px;

  &:last-child {
    border-bottom: none;
    padding-bottom: 0;
  }
`;

const SkillHeader = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  margin-bottom: 10px;
`;

const SkillName = styled.span`
  font-size: ${props => props.theme.fonts.sizes.base};
  font-weight: ${props => props.theme.fonts.weights.semibold};
  color: white;
`;

const SkillLevel = styled.span`
  font-size: ${props => props.theme.fonts.sizes.sm};
  font-weight: ${props => props.theme.fonts.weights.medium};
  color: #f093fb;
`;

const ProgressBarBackground = styled.div`
  width: 100%;
  height: 8px;
  background: rgba(255, 255, 255, 0.1);
  border-radius: 4px;
  overflow: hidden;
`;

const SkillProgress = styled(motion.div)`
  height: 100%;
  background: linear-gradient(90deg, #f093fb, #f5576c);
  border-radius: 4px;
  transform-origin: left;
`;

const CertificationsSection = styled(motion.div)`
  background: rgba(255, 255, 255, 0.1);
  backdrop-filter: blur(20px);
  border-radius: 25px;
  padding: 50px 40px;
  border: 1px solid rgba(255, 255, 255, 0.2);
  box-shadow: 
    0 20px 40px rgba(0, 0, 0, 0.2),
    0 0 0 1px rgba(255, 255, 255, 0.1);
  margin-bottom: 60px;
  position: relative;
  overflow: hidden;

  &::before {
    content: '';
    position: absolute;
    top: 0;
    left: 0;
    right: 0;
    height: 4px;
    background: linear-gradient(90deg, #f093fb, #f5576c);
  }
`;

const CertificationsTitle = styled.h3`
  font-size: ${props => props.theme.fonts.sizes.xl};
  font-weight: ${props => props.theme.fonts.weights.bold};
  color: white;
  text-align: center;
  margin-bottom: 40px;
  display: flex;
  align-items: center;
  justify-content: center;
  gap: 15px;
`;

const CertificationsGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(300px, 1fr));
  gap: 30px;

  @media (max-width: ${props => props.theme.breakpoints.md}) {
    grid-template-columns: 1fr;
  }
`;

const CertificationCard = styled(motion.div)`
  background: rgba(255, 255, 255, 0.1);
  border-radius: 20px;
  padding: 25px;
  border: 1px solid rgba(255, 255, 255, 0.2);
  transition: all 0.3s ease;

  &:hover {
    transform: translateY(-5px);
    background: rgba(255, 255, 255, 0.15);
    box-shadow: 0 15px 35px rgba(0, 0, 0, 0.2);
  }
`;

const CertificationName = styled.h4`
  font-size: ${props => props.theme.fonts.sizes.base};
  font-weight: ${props => props.theme.fonts.weights.bold};
  color: white;
  margin-bottom: 8px;
`;

const CertificationIssuer = styled.p`
  font-size: ${props => props.theme.fonts.sizes.sm};
  color: #f093fb;
  font-weight: ${props => props.theme.fonts.weights.medium};
  margin-bottom: 5px;
`;

const CertificationDate = styled.p`
  font-size: ${props => props.theme.fonts.sizes.xs};
  color: rgba(255, 255, 255, 0.7);
`;

const LanguagesSection = styled(motion.div)`
  background: rgba(255, 255, 255, 0.1);
  backdrop-filter: blur(20px);
  border-radius: 25px;
  padding: 50px 40px;
  border: 1px solid rgba(255, 255, 255, 0.2);
  box-shadow: 
    0 20px 40px rgba(0, 0, 0, 0.2),
    0 0 0 1px rgba(255, 255, 255, 0.1);
  position: relative;
  overflow: hidden;

  &::before {
    content: '';
    position: absolute;
    top: 0;
    left: 0;
    right: 0;
    height: 4px;
    background: linear-gradient(90deg, #f093fb, #f5576c);
  }
`;

const LanguagesTitle = styled.h3`
  font-size: ${props => props.theme.fonts.sizes.xl};
  font-weight: ${props => props.theme.fonts.weights.bold};
  color: #2d3748;
  text-align: center;
  margin-bottom: 40px;
  display: flex;
  align-items: center;
  justify-content: center;
  gap: 15px;
`;

const LanguagesGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(200px, 1fr));
  gap: 25px;

  @media (max-width: ${props => props.theme.breakpoints.md}) {
    grid-template-columns: repeat(auto-fit, minmax(150px, 1fr));
  }
`;

const LanguageCard = styled(motion.div)`
  background: linear-gradient(135deg, rgba(102, 126, 234, 0.1), rgba(118, 75, 162, 0.1));
  border-radius: 20px;
  padding: 25px;
  text-align: center;
  border: 1px solid rgba(102, 126, 234, 0.2);
  transition: all 0.3s ease;

  &:hover {
    transform: translateY(-5px);
    box-shadow: 0 15px 35px rgba(102, 126, 234, 0.2);
  }
`;

const LanguageName = styled.h4`
  font-size: ${props => props.theme.fonts.sizes.base};
  font-weight: ${props => props.theme.fonts.weights.bold};
  color: #2d3748;
  margin-bottom: 8px;
`;

const LanguageLevel = styled.p`
  font-size: ${props => props.theme.fonts.sizes.sm};
  color: #667eea;
  font-weight: ${props => props.theme.fonts.weights.medium};
`;

const Skills = () => {
  const [skillsData, setSkillsData] = useState(null);
  const { ref, inView } = useInView({
    triggerOnce: true,
    threshold: 0.1,
  });

  useEffect(() => {
    const fetchSkillsData = async () => {
      try {
        const response = await fetch('/api/portfolio/skills');
        if (response.ok) {
          const data = await response.json();
          setSkillsData(data);
        }
      } catch (error) {
        console.error('Error fetching skills data:', error);
        // Fallback data
        setSkillsData({
          technical: [
            { name: "Product Strategy", level: 95 },
            { name: "Data Analysis", level: 90 },
            { name: "Machine Learning", level: 85 },
            { name: "SQL & Databases", level: 88 },
            { name: "Python", level: 82 },
            { name: "R Programming", level: 80 },
            { name: "A/B Testing", level: 92 },
            { name: "User Research", level: 88 }
          ],
          tools: [
            { name: "JIRA", level: 95 },
            { name: "Salesforce", level: 85 },
            { name: "Mixpanel", level: 90 },
            { name: "Tableau", level: 82 },
            { name: "Figma", level: 78 },
            { name: "Power BI", level: 85 }
          ],
          soft: [
            { name: "Stakeholder Management", level: 92 },
            { name: "Team Leadership", level: 88 },
            { name: "Strategic Planning", level: 90 },
            { name: "Cross-functional Collaboration", level: 85 },
            { name: "Problem Solving", level: 93 },
            { name: "Communication", level: 90 }
          ]
        });
      }
    };

    fetchSkillsData();
  }, []);

  const skillCategories = [
    {
      title: "Core Skills",
      icon: <FaCode />,
      skills: skillsData?.technical || []
    },
    {
      title: "Tools & Platforms",
      icon: <FaTools />,
      skills: skillsData?.tools || []
    },
    {
      title: "Leadership & Soft Skills",
      icon: <FaCertificate />,
      skills: skillsData?.soft || []
    }
  ];

  const certifications = [
    {
      name: "Data Science Professional Certificate",
      issuer: "LinkedIn Learning",
      date: "2023"
    },
    {
      name: "Machine Learning Specialization",
      issuer: "Coursera",
      date: "2022"
    },
    {
      name: "Product Management Certification",
      issuer: "Product School",
      date: "2021"
    },
    {
      name: "Agile Project Management",
      issuer: "Scrum Alliance",
      date: "2020"
    }
  ];

  const languages = [
    { name: "English", level: "Native" },
    { name: "Hindi", level: "Native" },
    { name: "Gujarati", level: "Fluent" }
  ];

  if (!skillsData) {
    return <div>Loading...</div>;
  }

  return (
    <SkillsContainer id="skills">
      <Container ref={ref}>
        <SectionHeader
          initial={{ opacity: 0, y: 50 }}
          animate={inView ? { opacity: 1, y: 0 } : {}}
          transition={{ duration: 0.8 }}
        >
          <SectionTitle>Skills & Expertise</SectionTitle>
          <SectionSubtitle>
            A comprehensive toolkit for building innovative products and leading teams
          </SectionSubtitle>
        </SectionHeader>

        <SkillsGrid>
          {skillCategories.map((category, index) => (
            <SkillCategory
              key={category.title}
              initial={{ opacity: 0, y: 30 }}
              animate={inView ? { opacity: 1, y: 0 } : {}}
              transition={{ duration: 0.6, delay: 0.2 + index * 0.1 }}
            >
              <CategoryHeader>
                <CategoryIcon>
                  {category.icon}
                </CategoryIcon>
                <CategoryTitle>{category.title}</CategoryTitle>
              </CategoryHeader>

              <SkillList>
                {category.skills.map((skill, skillIndex) => (
                  <SkillItem key={skill.name}>
                    <SkillHeader>
                      <SkillName>{skill.name}</SkillName>
                      <SkillLevel>{skill.level}%</SkillLevel>
                    </SkillHeader>
                    <ProgressBarBackground>
                      <SkillProgress
                        initial={{ scaleX: 0 }}
                        animate={inView ? { scaleX: skill.level / 100 } : {}}
                        transition={{ duration: 1, delay: 0.5 + skillIndex * 0.1 }}
                      />
                    </ProgressBarBackground>
                  </SkillItem>
                ))}
              </SkillList>
            </SkillCategory>
          ))}
        </SkillsGrid>

        <CertificationsSection
          initial={{ opacity: 0, y: 50 }}
          animate={inView ? { opacity: 1, y: 0 } : {}}
          transition={{ duration: 0.8, delay: 0.6 }}
        >
          <CertificationsTitle>
            <FaCertificate />
            Certifications & Training
          </CertificationsTitle>

          <CertificationsGrid>
            {certifications.map((cert, index) => (
              <CertificationCard
                key={cert.name}
                initial={{ opacity: 0, y: 20 }}
                animate={inView ? { opacity: 1, y: 0 } : {}}
                transition={{ duration: 0.6, delay: 0.8 + index * 0.1 }}
              >
                <CertificationName>{cert.name}</CertificationName>
                <CertificationIssuer>{cert.issuer}</CertificationIssuer>
                <CertificationDate>{cert.date}</CertificationDate>
              </CertificationCard>
            ))}
          </CertificationsGrid>
        </CertificationsSection>

        <LanguagesSection
          initial={{ opacity: 0, y: 50 }}
          animate={inView ? { opacity: 1, y: 0 } : {}}
          transition={{ duration: 0.8, delay: 0.8 }}
        >
          <LanguagesTitle>
            <FaLanguage />
            Languages
          </LanguagesTitle>

          <LanguagesGrid>
            {languages.map((language, index) => (
              <LanguageCard
                key={language.name}
                initial={{ opacity: 0, y: 20 }}
                animate={inView ? { opacity: 1, y: 0 } : {}}
                transition={{ duration: 0.6, delay: 1 + index * 0.1 }}
              >
                <LanguageName>{language.name}</LanguageName>
                <LanguageLevel>{language.level}</LanguageLevel>
              </LanguageCard>
            ))}
          </LanguagesGrid>
        </LanguagesSection>
      </Container>
    </SkillsContainer>
  );
};

export default Skills;
